import React from 'react';
import { Bracket as TournamentBracket } from 'react-tournament-bracket';

const Brackets = () => {
  const bracketData = {
    results: [
      [{ name: 'Team A', winner: true }, { name: 'Team B' }],
      [{ name: 'Team C' }, { name: 'Team D', winner: true }],
      [{ name: 'Team E', winner: true }, { name: 'Team F' }],
      [{ name: 'Team G' }, { name: 'Team H', winner: true }],
      [{ name: 'Team A', winner: true }, { name: 'Team D' }],
      [{ name: 'Team E', winner: true }, { name: 'Team H', winner: true }],
      [{ name: 'Team A', winner: true }, { name: 'Team H' }],
    ],
  };

  return (
    <div style={{ maxWidth: '800px', margin: 'auto' }}>
      <TournamentBracket
        gameSize={[120, 60]}
        teamSize={4}
        scale={0.7}
        gameMargin={5}
        rounds={bracketData.results}
        render={() => (
          <div
            style={{
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              height: '100%',
              fontSize: '20px',
              fontWeight: 'bold',
            }}
          >
            Champion
          </div>
        )}
      />
    </div>
  );
};

export default Brackets;
